import React from 'react';


class NOKPhone extends React.Component {
    render() {
        return (
          <form classname="container" formtext-padding="10 px">
            <div className="container">
                <p>NOK - Phone:</p>
                <input type="tel" margin="10 px"/>
            </div>
        </form>
        );
      }
  }

  export default NOKPhone;
